BotaoPrincipal::BotaoPrincipal()
{
    imagem = carregaBotaoPrincipal();
    if (!imagem)
    {
        allegro_message("iei");
        exit(1);
    }
    largura = imagem->w;
    x = SCREEN_W/2 - largura/2;
    y = 20;
    altura = imagem->h/4;
    apertado = false;
    vitoria = false;
    derrota = false;
    mouseAnt = false;
}

BotaoPrincipal::~BotaoPrincipal()
{
    destroy_bitmap(imagem);
}

void BotaoPrincipal::setDerrota(bool derrota_)
{
    derrota = derrota_;
}

void BotaoPrincipal::setVitoria(bool vitoria_)
{
    vitoria = vitoria_;
}

void BotaoPrincipal::draw(BITMAP* buffer)
{
    int y2 = 0;
    if (vitoria) y2 = altura*3;
    if (derrota) y2 = altura*2;
    if (apertado) y2 = altura;
    masked_blit(imagem,buffer, 0, y2, x, y, largura, altura);
}

 bool BotaoPrincipal::clique()
 {
    if (!key[KEY_F2])
    {
        if (mouse_x <= x || mouse_x >= x + largura || mouse_y <= y || mouse_y >= y + altura)
        {
            apertado = false;
            mouseAnt = false;
            return false;
        }
    }
    bool b = (mouseAnt && !apertado) || key[KEY_F2]; //Só dá certo se soltar o clique dentro do botão
    mouseAnt = apertado;
    apertado = mouse_b || key[KEY_F2];
    return b;
 }
